import React, { Component } from 'react';

class HomePage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            properties: [],
            // Get the search parameters from the location state
            ...props.location.state
        };
    }

    componentDidMount() {
        // Fetch the properties based on the search parameters and update the state
        // This is just a placeholder, replace it with your actual fetch function
        // fetchProperties(this.state).then(properties => {
        //     this.setState({ properties });
        // });
    }

    render() {
        return (
            <div>
                {this.state.properties.map(property => (
                    <div key={property.id}>
                        <h2>{property.hotel}</h2>
                        <p>{property.price}</p>
                    </div>
                ))}
            </div>
        );
    }
}

export default HomePage;
